		repeat wait(.2) until Base.Position == UDim2.new(0,0,0.5,-20)
		Box:CaptureFocus()
		repeat wait(.2) until Base.Position == UDim2.new(0,0,0.5,-20)
		Debounce = false
	elseif Open and not Debounce then
		Open = false
		Debounce = true
		Base:TweenPosition(UDim2.new(0,0,1,5),'Out','Quint',0.35,true)
		repeat wait(.2) until Base.Position == UDim2.new(0,0,1,5)
		Base.Position = UDim2.new(0,0,-1,-5)
		repeat wait(.2) until Base.Position == UDim2.new(0,0,-1,-5)
		Box.TextLabel.Text = ('Enter a username to give an item')
		Decoy.Visible = false
		Debounce = false
	end
end

